import React from "react";
import ScrollAnimation from "react-animate-on-scroll";
import { FiMail } from "react-icons/fi";
import { Link } from "react-router-dom";
const CallToAction = ({ textAlign, serviceStyle }) => {
  return (
    <div
      className="rn-callto-action clltoaction-style-default style-6 bg_image bg_image_fixed"
      style={{ backgroundImage: `url(/images/timeline/subs1.jpg)` }}
      data-black-overlay="8"
    >
      <div className="container ">
        <main>
          <div className="row row--15 service-wrapper center align-content-center align-self-center justify-center justify-content-center ">
            <div className="container row">
              <div
                className="col-lg-4 col-xl-4 col-4 "
                style={{ paddingLeft: "100px" }}
              >
                <div className="thumbnail image-left-content">
                  <img
                    src="./images/ihelplogo/magazineW1.png"
                    alt="banner123"
                    style={{
                      borderRadius: "10px",
                      paddingLeft: "30px",
                    }}
                  />
                </div>
              </div>
              <div className="row row--30 align-items-center">
                <div className="col-lg-10 offset-lg-1">
                  <div className="inner">
                    <div className="content text-center">
                      <h2 className="title mb--0">Уншигч танд зориулав</h2>
                      <p>
                        Өөрийгөө хөгжүүлэх хэрэгцээт, цаг үеийн чанартай
                        контентүүдыг тогтмол хүлээн аваарай
                      </p>
                      <form
                        className="blog-search"
                        action="#"
                        // onSubmit={handleAddMagazineSubs}
                      >
                        <input
                          type="text"
                          name="name"
                          // onChange={handleAddMagazineSubmit}
                          placeholder="И-мэйл хаягаа бичнэ үү  "
                        />
                        <button className="search-button " type="submit">
                          <FiMail />
                        </button>
                      </form>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </main>
      </div>
    </div>
  );
};
export default CallToAction;
